import React from 'react'

const Todolist = ({ item, i, setItem }) => {
  let handleDelete = (i) => {
    setItem((preVal) => {
      return preVal.filter((elem, index) => {
        return index !== i
      })
    })
  }
  return (
    <div className="d-flex flex-column align-items-center">
    <div >
      <p style={{ listStyle: "none" }}>{i + 1}. {item}</p>
      
        <button className='btn btn-success mx-1'>Edit</button>
        <button className='btn btn-danger mx-2' onClick={() => { handleDelete(i) }}>Delete</button>
      
    </div>
    </div>
  )
}

export default Todolist
